script: |
  super -f tsv -I q4551.sql | sort > q4551.out

vector: true

inputs:
  - name: q4551.sql
    data: |
      SELECT ALL + ( col0 ) FROM tab1 GROUP BY col0, col2 HAVING NULL NOT IN ( + col2 / - - 92 / - col2 * - col0, + COALESCE ( + + CAST ( - - col2 AS INTEGER ), - col0 ) );
  - name: tab1

outputs:
  - name: q4551.out
    data: |
